import React, { useState } from 'react';
import { AgChartsReact } from 'ag-charts-react';

// Chart Component
const Visibility = ({data}) => {
  const data_parse = data.list.splice(0,8)
  const [chartOptions, setChartOptions] = useState({
    // Data: Data to be displayed in the chart
    timeVis: [
        { time: data_parse[0].dt_txt.slice(11,13), visibility: data_parse[0].visibility},
        { time: data_parse[1].dt_txt.slice(11,13), visibility: data_parse[1].visibility},
        { time: data_parse[2].dt_txt.slice(11,13), visibility: data_parse[2].visibility},
        { time: data_parse[3].dt_txt.slice(11,13), visibility: data_parse[3].visibility},
        { time: data_parse[4].dt_txt.slice(11,13), visibility: data_parse[4].visibility},
        { time: data_parse[5].dt_txt.slice(11,13), visibility: data_parse[5].visibility},
        { time: data_parse[6].dt_txt.slice(11,13), visibility: data_parse[6].visibility},
        { time: data_parse[7].dt_txt.slice(11,13), visibility: data_parse[7].visibility},
        { time: data_parse[8].dt_txt.slice(11,13), visibility: data_parse[8].visibility},
    ],
    // Series: Defines which chart type and data to use
    series: [{ type: 'line', xKey: 'time', yKey: 'visibility (km)' }],
  });
  return (
    // AgCharsReact component with options passed as prop
    chartOptions
  );
}

export default Visibility;
